import logo from "/home/civodulap/workshop/workshopreact/src/img/logo.png"

function nav_bar() {
    return (
        <nav>
            <div class="nav_bar">
                <img src={logo}></img>
                <ul id="nav_bar" class="right hide-on-med-and-down">
                    <li><a href="sass.html">Home</a></li>
                    <li><a href="badges.html">Menu</a></li>
                    <li><a href="collapsible.html">Contact</a></li>
                </ul>
            </div>
        </nav>
    );
}
export default nav_bar;
